DROP TABLE IF EXISTS Cursos;

CREATE TABLE `Cursos` (
  `IDestudiante` int(11) NOT NULL,
  `IDClase` int(11) NOT NULL,
  `IDTurno` int(11) NOT NULL
) ENGINE=MyISAM DEFAULT CHARSET=latin1 COLLATE=latin1_general_ci;

INSERT INTO Cursos VALUES("0","0","1");


DROP TABLE IF EXISTS Departamento;

CREATE TABLE `Departamento` (
  `IDDepartamento` int(11) NOT NULL AUTO_INCREMENT,
  `Nombre` varchar(45) COLLATE latin1_general_ci NOT NULL,
  `Descripcion` varchar(45) COLLATE latin1_general_ci NOT NULL,
  PRIMARY KEY (`IDDepartamento`)
) ENGINE=MyISAM AUTO_INCREMENT=4 DEFAULT CHARSET=latin1 COLLATE=latin1_general_ci;

INSERT INTO Departamento VALUES("1","Matematica ","Departamento de Matemtica");
INSERT INTO Departamento VALUES("2","Historia ","Historia Humana de los tiempos");
INSERT INTO Departamento VALUES("3","Deporte","Departamentos de Atletas y Deportes ");


DROP TABLE IF EXISTS aulas;

CREATE TABLE `aulas` (
  `idAulas` int(11) NOT NULL AUTO_INCREMENT,
  `Codigo_aula` varchar(45) NOT NULL,
  `Descripcion` varchar(45) NOT NULL,
  `id_edificio` int(11) NOT NULL,
  PRIMARY KEY (`idAulas`)
) ENGINE=MyISAM AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;

INSERT INTO aulas VALUES("1","101","Laboratorio de Computadoras","2");
INSERT INTO aulas VALUES("2","Parte A","Parte de edificio con espejos","1");
INSERT INTO aulas VALUES("3","101","Clase cuarto con 35 escritorios ","3");


DROP TABLE IF EXISTS cargos;

CREATE TABLE `cargos` (
  `idCargos` int(11) NOT NULL AUTO_INCREMENT,
  `Cargo` varchar(45) NOT NULL,
  `DescripCar` varchar(100) NOT NULL,
  PRIMARY KEY (`idCargos`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;



DROP TABLE IF EXISTS clases;

CREATE TABLE `clases` (
  `idClases` int(11) NOT NULL AUTO_INCREMENT,
  `Nombre_clase` varchar(45) NOT NULL,
  `IDDepartamento` int(11) DEFAULT NULL,
  `idProfesores` int(11) DEFAULT NULL,
  `idAulas` int(11) DEFAULT NULL,
  `IDNivel` int(11) DEFAULT NULL,
  `Activo` tinyint(1) DEFAULT NULL,
  `idTurno` int(11) DEFAULT NULL,
  PRIMARY KEY (`idClases`)
) ENGINE=MyISAM AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;

INSERT INTO clases VALUES("1","Matematica Sumatoria","1","6","1","3","1","1");
INSERT INTO clases VALUES("2","Historia informatica","2","8","2","9","1","0");
INSERT INTO clases VALUES("3","Ballet de Jazz","3","","2","","","0");


DROP TABLE IF EXISTS edificios;

CREATE TABLE `edificios` (
  `idEdificios` int(11) NOT NULL AUTO_INCREMENT,
  `Codigo_edificio` varchar(45) NOT NULL,
  `descripcion` varchar(45) NOT NULL,
  PRIMARY KEY (`idEdificios`)
) ENGINE=MyISAM AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;

INSERT INTO edificios VALUES("1","A","Auditorio");
INSERT INTO edificios VALUES("2","B","Edificio B al Centro");
INSERT INTO edificios VALUES("3","C","Edificio C cerca de la entrada");


DROP TABLE IF EXISTS estudiantes;

CREATE TABLE `estudiantes` (
  `idEstudiantes` int(11) NOT NULL AUTO_INCREMENT,
  `Estudiante_names` varchar(45) NOT NULL,
  `Estudiantes_apellidos` varchar(45) NOT NULL,
  `ES_dia` varchar(2) NOT NULL,
  `ES_mes` varchar(15) NOT NULL,
  `ES_anio` varchar(4) NOT NULL,
  `direccion` varchar(100) NOT NULL,
  `telefono` varchar(8) DEFAULT NULL,
  `celular` varchar(8) NOT NULL,
  `email` varchar(50) DEFAULT NULL,
  `sexo` varchar(1) NOT NULL,
  `nivel` varchar(8) DEFAULT NULL,
  `notas` int(11) DEFAULT NULL,
  `Tutores_idTutores` int(11) DEFAULT NULL,
  `nacionalidad` varchar(45) NOT NULL,
  `Cedula` varchar(15) DEFAULT NULL,
  `Activo` tinyint(1) NOT NULL,
  `Fotos_idphoto` mediumblob NOT NULL,
  `Ciudad` varchar(45) NOT NULL,
  `ES_insdia` varchar(2) NOT NULL,
  `ES_insmes` varchar(30) NOT NULL,
  `ES_insanio` varchar(4) NOT NULL,
  `Ultima Actualizacion` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`idEstudiantes`),
  UNIQUE KEY `nivel_UNIQUE` (`nivel`),
  UNIQUE KEY `notas_UNIQUE` (`notas`),
  KEY `fk_Estudiantes_Tutores1_idx` (`Tutores_idTutores`)
) ENGINE=MyISAM AUTO_INCREMENT=31 DEFAULT CHARSET=utf8;

