DROP TABLE IF EXISTS notas;

CREATE TABLE `notas` (
  `idNotas` int(11) NOT NULL AUTO_INCREMENT,
  `idmateria` int(11) NOT NULL,
  `idestudiante` int(11) NOT NULL,
  `iddetallesnotas` int(11) NOT NULL,
  `Materia_idMateria` int(11) NOT NULL,
  `Materia_Profesores_idProfesores` int(11) NOT NULL,
  `Estudiantes_idEstudiantes` int(11) NOT NULL,
  PRIMARY KEY (`idNotas`),
  UNIQUE KEY `iddetallesnotas_UNIQUE` (`iddetallesnotas`),
  UNIQUE KEY `idestudiante_UNIQUE` (`idestudiante`),
  UNIQUE KEY `idmateria_UNIQUE` (`idmateria`),
  KEY `fk_Notas_Materia1_idx` (`Materia_idMateria`,`Materia_Profesores_idProfesores`),
  KEY `fk_Notas_Estudiantes1_idx` (`Estudiantes_idEstudiantes`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;



DROP TABLE IF EXISTS personal;

CREATE TABLE `personal` (
  `idPersonal` int(11) NOT NULL AUTO_INCREMENT,
  `Personal_nombres` varchar(45) NOT NULL,
  `Personal_apellidos` varchar(45) NOT NULL,
  `telefono` varchar(8) NOT NULL,
  `celular` varchar(8) DEFAULT NULL,
  `salario` varchar(45) NOT NULL,
  `email` varchar(50) DEFAULT NULL,
  `direccion` varchar(45) NOT NULL,
  `id_cargo` int(11) NOT NULL,
  `Sexo_idSexo` int(11) NOT NULL,
  PRIMARY KEY (`idPersonal`),
  KEY `fk_Personal_Sexo1_idx` (`Sexo_idSexo`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;



DROP TABLE IF EXISTS profesores;

CREATE TABLE `profesores` (
  `idProfesores` int(11) NOT NULL AUTO_INCREMENT,
  `profesores_nombres` varchar(45) DEFAULT NULL,
  `Profesores_apellidos` varchar(45) DEFAULT NULL,
  `Sexo` varchar(45) DEFAULT NULL,
  `telefono` varchar(45) DEFAULT NULL,
  `celular` varchar(45) DEFAULT NULL,
  `Cedula` varchar(45) DEFAULT NULL,
  `direccion` varchar(45) DEFAULT NULL,
  `Nacionalidad` varchar(45) DEFAULT NULL,
  `Ciudad` varchar(45) DEFAULT NULL,
  `correo` varchar(50) DEFAULT NULL,
  `IDDepartamento` int(11) DEFAULT NULL,
  `Salario` float DEFAULT NULL,
  `Dinero` varchar(45) DEFAULT NULL,
  `FotoProf` mediumblob,
  `ProfDia` varchar(2) DEFAULT NULL,
  `ProfMes` varchar(45) DEFAULT NULL,
  `ProfAnio` varchar(4) DEFAULT NULL,
  `id_Turno` int(11) NOT NULL,
  `IDCargo` int(11) DEFAULT NULL,
  `Activo` tinyint(1) DEFAULT NULL,
  PRIMARY KEY (`idProfesores`)
) ENGINE=MyISAM AUTO_INCREMENT=9 DEFAULT CHARSET=utf8;

